import React, { useCallback,useEffect, useState, createRef } from 'react'


const UserList = ({users}) =>{


  const [array,setArray] = useState([]); 

  useEffect(()=>{

    setArray([...users]); 
  },[])
  

  return (
    <div>
    {array.map((v)=>(
      <div>{v}</div>
    ))}
    </div>

  )
}

export default UserList;
